import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import state from './Readux/State'
import {addMessage} from "./Readux/State";
addMessage('88888888888888')
ReactDOM.render(
        <App state={state} addMessage={addMessage} />,
    document.getElementById('root')
);

